import { Link,NavLink } from "react-router-dom"
import "./Barra.css";

const Barra = () => {
  return (
    <div>
        <nav className="nave">
            <NavLink to="/" className={({isActive}) => (isActive ? "ativo" : "")} style={{listStyle: "none"}}>Home</NavLink>
            <NavLink to="/Novidades" className={({isActive}) => (isActive ? "ativo" : "")}style={{listStyle: "none"}}>Novidades</NavLink>
        </nav>
    </div>
  )
}

export default Barra
